import ExpenseItem from './ExpenseItem';
import './Expenses.css';
function Expenses(props){

    return(
        <div className='expenses'>
    <ExpenseItem x={props.arr[0].title} y={props.arr[0].amount} z={props.arr[0].date}></ExpenseItem>
    <ExpenseItem x={props.arr[1].title} y={props.arr[1].amount} z={props.arr[1].date}></ExpenseItem>
    <ExpenseItem x={props.arr[2].title} y={props.arr[2].amount} z={props.arr[2].date}></ExpenseItem>
    <ExpenseItem x={props.arr[3].title} y={props.arr[3].amount} z={props.arr[3].date}></ExpenseItem>
    </div>
    );
}

export default Expenses;
